  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;In considering targets for&amp;nbsp;human
  asteroid missions, there are several major factors that will make a significant
  difference in assessment of mission risks that can be addressed by simple photo-reconnaissance
  of a target. One of the most important of these factors is the spin state of the
  asteroid: does it rotate in a slow, easily predictable way? Asteroids that rotate
  very rapidly or that tumble about multiple axes present significant hazards in planning
  and executing proximity operations&amp;minus; especially operations that must be
  carried out over extended time periods.&amp;nbsp; Another consideration is the physical
  state of the asteroid itself: is it a coherent mass or does it consist of a gravitationally
  bound pile of much smaller pieces? A coherent structure is unlikely to rearrange
  its configuration in response to a push by an astronaut or a hardware deployment
  and will provide a much easier surface in which to plant anchors for astronaut mobility
  or to hold equipment to the surface than will a rubble pile.&lt;/p&gt;&lt;p&gt;The
  full success criteria entails flying by a near Earth asteroid and acquire images
  sufficient to determine the target volume, shape model, Asteroid spectral type and
  meteorite analogs, rotational properties (pole position, rotation period), orbit,
  debris/dust field in local environment, and regolith characteristics.&lt;/p&gt;&lt;p&gt;Meeting
  this requirement&amp;nbsp;addresses the need to fill Strategic Knowledge Gaps (SKG&amp;rsquo;s)
  related to asteroids as a precursor to subsequent safe and successful human missions.&amp;nbsp;
  The data obtained will also support the advancement of science interests in asteroids.&lt;/p&gt;\",\n\t\"license_title\":
